		const keys = Object.keys(friends);
	return (

		<div>
		<br></br>

		{keys.map( (item) => {
			friends[item].map( (place) => {
			return(
		<Grid columns={1}>
      	<Grid.Column>


  		<p>{item} updated his restaurant list</p>
		<Menu.Item as='a' onClick={this.props.searchFriendChoice.bind(this, place)}>
		</Menu.Item>

		</Grid.Column>
		</Grid>

		)
		})
		})}
		</div>

		);
}
}


